####all relevant Hexose transporter experiment data in one file. last updat 20170315
###creates a data structure called experimentData. 
####experimentData is a dictionary of the form
#####experimentData[EXPT_DATE] ['time']			the timepoints of the experiment in hrs
#				['input']		the normalised input 
#		              ['strains']    the name of each of the strains in the experiment.
#		               ['means']      the mean expression data for each of the 'strains', by column
 

from numpy import array, where, size
####all Experiments in one file
###the experimentData variable contains replicate info.
### the mean is the 
experimentData={}

###experimentFunctions. functions to get specific information about the experiments
###retrieve data of one strain
def getStrain(expt, strain, bg=0):
	return experimentData[expt]['means'][:, where([j==strain for j in experimentData[expt]['strains']])].flatten()-bg
def getStrains(expt, strains, bg=0):
	out={}
	for j in strains:
		out[j]= getStrain(expt, j, bg)
	return out

 
